import React, { useState } from 'react'

export default function FormTodo() {
  let [title, setTitle] = useState <("Alice");

  return (
    <div>
      <input 
        type="text" 
        className="form-control" 
        placeholder='Add title todo'
        value = {title}
      />
      <button className='btn btn-danger'>Add</button>
    </div>
  );
}
